window.bookSummaryJSON = "<p><i>He’s a billionaire with his own label.</i></p> <p><i>She’s been in love with his best friend for years, or has she?</i><br> <i>Maybe with this upcoming auction,</i><br> <i>it’s time for Cru and Daphne to get a little WICKED.</i></p> <p>CRU<br> A relationship between us would be taboo and forbidden, but I can’t shake what I feel. She’s my best friend’s ex-girlfriend. They’ve been on; they’ve been off. But now that he’s married to someone else, it’s time to let her see how a real man can treat her—and to show her this guy she’s kept in the friend zone will be the hottest lover she’s ever known.</p> <p>DAPHNE<br> They say you don’t know what you’ve got until it’s gone. We were so hot and cold that I never knew if I had him or not. But when I needed him the most, his best friend came instead—yet again. Don’t get me wrong, Cru is my rock, my security, the one who always shows up.</p> <p>But when Cru is the one walking out, showing me what it’s like to miss him, I realize he’s the one I’ve truly loved all along. Now, I have to prove to him that there’s only one WICKED WINEMAKER for me.</p> <p><i>While each title in this series is a standalone featuring one couple with their own HEA, the books in the series will be more enjoyable read in order.</i></p>"; 
